// Monta a query SQL para selecionar todas as variáveis
msg.topic = `
SELECT data_hora AS time, pv_nivel, mv_valvula, sp_nivel
FROM medidas_planta
ORDER BY data_hora ASC;
`;

return msg;

let resultados = msg.payload;

if (resultados.length > 0) {
    let ultimo = resultados[resultados.length - 1];
    msg.payload = {
        pv_nivel: ultimo.pv_nivel,
        mv_valvula: ultimo.mv_valvula,
        sp_nivel: ultimo.sp_nivel
    };
} else {
    msg.payload = null;
}

return msg;

// Lê os valores do msg.payload usando os nomes corretos
// Usamos colchetes [] porque "Nível Tanque" tem um espaço
let pv_nivel = msg.payload["Nível Tanque"];
let mv_valvula = msg.payload["MV_Válvula"];
let sp_nivel = msg.payload["SP_Nível"];

// 1. Define o comando SQL (query) no msg.topic
// Usamos '?' como placeholders para os valores.
msg.topic = `
INSERT INTO medidas_planta 
    (pv_nivel, mv_valvula, sp_nivel, data_hora)
VALUES 
    (?, ?, ?, NOW());
`;

// 2. Passa os valores em um array no msg.payload
// O nó do MySQL vai substituir os '?' na ordem em que aparecem.
msg.payload = [
    pv_nivel,
    mv_valvula,
    sp_nivel
];

// Armazena os valores para debug, se necessário (opcional)
msg.valores = {
    pv_nivel: pv_nivel,
    mv_valvula: mv_valvula,
    sp_nivel: sp_nivel
};

return msg;
